// evaluateConditionalExpression pulled from https://github.com/Audet-Magna/expression-builder-dev-helper/blob/e7d068937817186163964af0b3fd82e33e4f2c06/Program.cs
// commit dated 2025-10-08
bool evaluateConditionalExpression(string expression) {
  if (expression == "*" || expression == "")
    return true;

  var boolOps = new System.Collections.Generic.List<(string, Func<string, string, bool>)> {
      ("==", (a, b) => a == b),
      ("!=", (a, b) => a != b),
      (">=", (a, b) => dblParse(a) >= dblParse(b)),
      ("<=", (a, b) => dblParse(a) <= dblParse(b)),
      (">",  (a, b) => dblParse(a) > dblParse(b)),
      ("<",  (a, b) => dblParse(a) < dblParse(b)),
      ("!~=~",  (a, b) => !a.Contains(b)),
      ("!~=",  (a, b) => !a.StartsWith(b)),
      ("!=~",  (a, b) => !a.EndsWith(b)),
      ("~=~",  (a, b) => a.Contains(b)),
      ("~=",  (a, b) => a.StartsWith(b)),
      ("=~",  (a, b) => a.EndsWith(b)),
    };

  string evaluateXPath(XmlNode node, string xpath) {
    if (node == null)
      return "";
    var xpathnav = node.CreateNavigator();
    var compiled = xpathnav.Compile(xpath);

    if (compiled.ReturnType == System.Xml.XPath.XPathResultType.Number)
      return xpathnav.Evaluate(compiled).ToString();
    if (compiled.ReturnType == System.Xml.XPath.XPathResultType.Navigator)
      return xpathnav.Evaluate(compiled).ToString();
    if (compiled.ReturnType == System.Xml.XPath.XPathResultType.NodeSet)
      return xpathnav.SelectSingleNode(compiled)?.Value ?? "";
    return "";
  }

  double dblParse(string str) => double.Parse(str, System.Globalization.CultureInfo.InvariantCulture);

  bool evaluateSingleConditionalExpression(string singleExpression) {
    foreach (var (op, evalFunc) in boolOps) {
      if (singleExpression.Contains(op)) {
        try {
          return evalFunc(singleExpression.Split(op)[0].Trim(), singleExpression.Split(op)[1].Trim());
        } catch {
          return false;
        }
      }
    }
    throw new Exception("Exhausted splitters and found no match");
  }

  string substituteVariables(string subsExpression) {
    System.Collections.Generic.List<string> splits = boolOps.ConvertAll(b => b.Item1);
    splits.Add("&&");
    splits.Add("||");
    System.Collections.Generic.List<string> variableCandidates = new(subsExpression.Split(splits.ToArray(), StringSplitOptions.None));
    foreach (string variableCandidateUntrimmed in variableCandidates) {
      string variableCandidate = variableCandidateUntrimmed.Trim();

      string varPrefixedRegex = "^[a-zA-Z0-9]*\\.[a-zA-Z0-9_]*\\|.*$";
      var test = new System.Text.RegularExpressions.Regex(varPrefixedRegex);
      if (test.IsMatch(variableCandidate)) {
        string xmlVarName = variableCandidate.Split('|')[0].Split('.')[0];
        string rootNodeName = variableCandidate.Split('|')[0].Split('.')[1];
        string xPath = variableCandidate.Split('|')[1];
        subsExpression = subsExpression.Replace(variableCandidate, evaluateXPath(_context.XmlVariables[xmlVarName].GetXmlNode("//" + rootNodeName), xPath));
      } else if (variableCandidate.Contains("|//")) {
        string xmlVarName = variableCandidate.Split('|')[0];
        string xPath = variableCandidate.Split('|')[1];
        subsExpression = subsExpression.Replace(variableCandidate, evaluateXPath(_context.XmlVariables[xmlVarName].GetXmlNode(xPath), xPath));
      } else if (variableCandidate.StartsWith("//")) {
        //try to find node by xpath in docGenData
        var docGenRoot = _context.XmlVariables["docGenData"].GetXmlNode("//*") ?? _context.XmlVariables["docGenData"].GetXmlNode("//TemplateFieldData");
        subsExpression = subsExpression.Replace(variableCandidate, evaluateXPath(docGenRoot, variableCandidate));
      } else if (variableCandidate.StartsWith("\"") && variableCandidate.EndsWith("\"")) {
        //this is a string. Remove its quotes.
        subsExpression = subsExpression.Replace(variableCandidate, variableCandidate.Substring(1, variableCandidate.Length - 2));
      } else if (char.IsDigit(variableCandidate[0])) {
        //do nothing, this is a number
      } else {
        //this is a variable. Use GetVariableValue to substitute it.
        //NOTE: the below naively assumes the variable name only appears once.
        subsExpression = subsExpression.Replace(variableCandidate, GetVariableValue(variableCandidate));
      }
    }
    return subsExpression;
  }

  try {
    return System.Linq.Enumerable.Any(expression.Split("||", StringSplitOptions.None), orExp =>
      System.Linq.Enumerable.All(orExp.Split("&&", StringSplitOptions.None), andExp =>
        evaluateSingleConditionalExpression(substituteVariables(andExp))));
  } catch {
    return false;
  }
}

