static bool IsStatusIneligibleForAssignment(string status) =>
    System.Linq.Enumerable.Any(new[] { "active", "activating", "approved", "rejected", "not selected", "skipped" }, s => status.StartsWith(s));

bool isApprovalAssignable(XmlNode approval) {
  string getStatus(XmlNode approval) => approval.SelectSingleNode("status").InnerText.ToLower();
  var status = getStatus(approval);
  if (IsStatusIneligibleForAssignment(status)) {
    return false;
  }

  if (!evaluateConditionalExpression(approval.SelectSingleNode("Conditional").InnerText)) {
    return false;
  }

  string[] ApprovalDependencies = Array.FindAll(approval.SelectSingleNode("ApprovalDependencies").InnerText.Split(","), ad => ad != "");

  foreach (string ApprovalDependency in ApprovalDependencies) {
    var approvalDep = ret.SelectSingleNode("Row[Approval='" + ApprovalDependency + "']");
    if (!new System.Collections.Generic.List<string> { "approved", "skipped", "not selected" }.Contains(getStatus(approvalDep))
    && evaluateConditionalExpression(approvalDep.SelectSingleNode("Conditional").InnerText))
      return false;
  }
  return true;
}

